import React from "react";

function LeftSection({
  imageURL,
  productName,
  productDescription,
  tryDemo,
  learnMore,
  googlePlay,
  appStore,
}) {
  return (
    <div className="container">
       <div className="row">
          <div className="col"></div>
          <div className="col"></div>
       </div>
    </div>
  );
}

export default LeftSection;
